import React from "react";
import Moment from "moment";

class Form extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      laaneBelop: null,
      nominellRente: null,
      terminGebyr: null,
      utlopsDato: null,
      saldoDato: null,
      datoForsteInnbetaling: null,
    };
  }
  mySubmitHandler = (event) => {
    event.preventDefault();
    alert("You are submitting " + this.state.laaneBelop);
    let jsonObject = {
      laanebelop: this.state.laaneBelop,
      nominellRente: this.state.nominellRente,
      terminGebyr: this.state.terminGebyr,
      utlopsDato: Moment(this.state.utlopsDato).format("YYYY-MM-DD"),
      saldoDato: Moment(this.state.saldoDato).format("YYYY-MM-DD"),
      datoForsteInnbetaling: Moment(this.state.datoForsteInnbetaling).format(
        "YYYY-MM-DD"
      ),
      ukjentVerdi: "TERMINBELOP",
    };
    console.log(JSON.stringify(jsonObject));
  };
  myChangeHandler = (event) => {
    let nam = event.target.name;
    let val = event.target.value;
    this.setState({ [nam]: val });
  };
  render() {
    return (
      <form onSubmit={this.mySubmitHandler}>
        <h1>Hello {this.state.datoForsteInnbetaling}</h1>
        <div class="form-row">
          <div class="col">
            <div class="form-group">
              <label>Lånebeløp</label>
              <input
                type="number"
                class="form-control"
                name="laaneBelop"
                onChange={this.myChangeHandler}
              />
            </div>
          </div>
          <div class="col">
            <div class="form-group">
              <label>Nominell rente</label>
              <input
                type="number"
                class="form-control"
                name="nominellRente"
                onChange={this.myChangeHandler}
              />
            </div>
          </div>
          <div class="col">
            <label>Termingebyr</label>
            <input
              type="number"
              class="form-control"
              name="terminGebyr"
              onChange={this.myChangeHandler}
            />
          </div>
        </div>
        <div class="form-row">
          <div class="col">
            <div class="form-group">
              <label>Utløpsdato</label>
              <input
                type="date"
                name="utlopsDato"
                onChange={this.myChangeHandler}
              />
            </div>
          </div>
          <div class="col">
            <div class="form-group">
              <label>Saldodato</label>
              <input
                type="date"
                name="saldoDato"
                onChange={this.myChangeHandler}
              />
            </div>
          </div>
          <div class="col">
            <div class="form-group">
              <label>Dato for første innbetaling</label>
              <input
                type="date"
                name="datoForsteInnbetaling"
                onChange={this.myChangeHandler}
              />
            </div>
          </div>
        </div>
        <button class="btn btn-primary" type="submit">
          Submit form
        </button>
      </form>
    );
  }
}

export default Form;
